import React from "react";
import Avatar from "@material-ui/core/Avatar";


//withStyles 
const styles = {
	BookAvatar: {
		display: "flex",
		flexDirection: "row",
		position: "absolute",
		left: "120px",
		width: "320px",
		height: "100%",
	},
};

function BookAvatar() {
	return (
		<div>
			<div className="book-logo">
				<Avatar alt="logo" src="logo.jpg" />
			</div>
		</div>
	);
}

export default BookAvatar;
